Information
------------------------------

Embarrassing Bodies: The Man with Half a Face
Christian Jessen tells the story of Eric Moger, who lost half his face to cancer four years ago. With the doctor's help, Eric and his fiancee Karen try to find a solution that will help him with his appearance and his ability to speak and eat as they look forward to their wedding. Experts at University College London Hospitals begin reconstructive surgery on their patient, using the latest technology and ground-breaking procedures.

